'),(691,59,'title_third','Wiley'),(692,59,'_title_third','field_6218bae1ca65e'),(693,59,'short_description_third','Pitching during a high school game.'),(694,59,'_short_description_third','field_6218baf2ca65f'),(695,59,'title_youth_baseball','How I Came To Love Youth Baseball'),(696,59,'_title_youth_baseball','field_6218b7bc96ae1'),(697,59,'description_youth_baseball','I am not a baseball guy, or least I wasn’t 15 years ago when my three boys started playing baseball.   Sure I was big into sports growing up in Nebraska were I played just about every sport under the sun.  It seems the only sport I didn’t play in an organized fashion was youth baseball.  It’s not baseball fault, but rather it was an issue of scheduling because track and baseball were both spring sports and my friends and I wanted to be Olympians not Major Leaguers.  Dare I say Bruce Jenner was my idol growing up.  Boy have times changed.'),(698,59,'_description_youth_baseball','field_6218b7d796ae2'),(699,59,'image','63'),(700,59,'_image','field_6218b7ef96ae3'),(701,59,'desigation_first','Founder & CEO'),(702,59,'_desigation_first','field_6218b97796ae4'),(703,59,'name','John <span>Irwin'),(704,59,'_name','field_6218b98296ae5'),(705,59,'title_baseball','BaseballConnected IL & MO'),(706,59,'_title_baseball','field_6218b99796ae6'),(707,59,'designation_second','Chief Cook & Bottle Washer'),(708,59,'_designation_second','field_6218b9b496ae7'),(709,59,'first_description_member_','I am telling you all this because when my three boys were growing up the only sport that registered on their radar was baseball.   Of course, the only sport they pick is the one I didn’t play growing up.  If that wasn’t enough, I had moved to Chicago before they were born which meant I had no clue who to call when it came time to fix their swings or to teach them the finer aspects of pitching.  Probably the most daunting task was trying to find local travel teams looking for players.  In those days, many teams kept their tryouts private so you needed to know someone to get an invite.  Talk about catch 22. '),(710,59,'_first_description_member_','field_6218b9da96ae8'),(711,59,'second_description_member_','Well, my boys and I made it through the youth baseball experience with more than our share of great memories.  Best of all, I developed a passion, or as my wife calls it an obsession, for youth baseball.  I also found my mission in life which is assisting people going through the youth baseball experience.  Towards this end, I created BaseballConnected with the hope that I could help people get better connected to their baseball community, thus the name of the website. '),(712,59,'_second_description_member_','field_6218ba0996ae9'),(713,59,'third_description_member_','Isn\'t it funny how life presents you with an opportunity when you least expect it.  For me, it was when my boys decided to play a sport I knew very little about.'),(714,59,'_third_description_member_','field_6218ba1596aea'),(715,180,'_edit_last','1'),(716,180,'_edit_lock','1646474930:1'),(717,95,'banner_title','contact us'),(718,95,'_banner_title','field_621c5f4bc7710'),(719,95,'logo_image','54'),(720,95,'_logo_image','field_621c5f56c7711'),(721,95,'email_id','John@BaseballConnected.com'),(722,95,'_email_id','field_621c5f92c7712'),(723,95,'mail_address','John@BaseballConnected.com'),(724,95,'_mail_address','field_621c5fa2c7713'),(725,95,'phone_number','630-991-0505'),(726,95,'_phone_number','field_621c5fd4c7714'),(727,95,'phone_address','630-991-0505'),(728,95,'_phone_address','field_621c5fe4c7715'),(729,95,'title_contact_form','Speak to Baseball Connected'),(730,95,'_title_contact_form','field_621c600ec7716'),(731,95,'title_looking_for','what are you looking For?'),(732,95,'_title_looking_for','field_621c6029c7717'),(733,95,'description_lookin_for','Baseball Connected is your resource for all things travel baseball teams, tryouts, and tournaments. '),(734,95,'_description_lookin_for','field_621c6038c7718'),(735,95,'button','Get