were limited places to go.'),(802,254,'_accordion_group_0_accordion_description_first','field_621e008e37dae'),(803,254,'accordion_group_0_accordion_description_second','The Aurora Travel Baseball Association was then formed as a not-for-profit 501(c)(3) organization to fill this need. Furthermore, three goals were set forth: (1) To prepare our players to be able to compete at the next major level, whether it be high school, college, or beyond; (2) To have more concern for the all around development of our players, than in securing wins; and, (3) To strive to have our Managers ASEP/IHSA coaching certified.'),(804,254,'_accordion_group_0_accordion_description_second','field_621e00bb37daf'),(805,254,'accordion_group_0_accordion_description_third','Aurora Travel Baseball (ATB) believes that there is room for all levels of baseball within our area. To this end, ATB reaches out to all surrounding communities in the Aurora, Illinois metropolitan area to find the best players with the desire for this type of intensive, competitive play. This results in our family of players coming from Aurora, Naperville, North Aurora, Oswego, Batavia, Yorkville, and other Fox Valley communities.'),(806,254,'_accordion_group_0_accordion_description_third','field_621e00c837db0'),(807,254,'accordion_group','4'),(808,254,'_accordion_group','field_621e006537dac'),(809,254,'accordion_group_1_accordion_title','Venues '),(810,254,'_accordion_group_1_accordion_title','field_621e008437dad'),(811,254,'accordion_group_1_accordion_description_first','Lorem ipsum dolor sit amet consectetur adipisicing elit.\r\nExcepturi at repellat quisquam, cupiditate quibusdam porro\r\nlaudantium odit deleniti maxime, delectus nam? Animi,\r\nofficiis, aliquam in a temporibus totam vel, illum dolorem\r\nnam porro illo natus corporis laboriosam dolores\r\nratione obcaecati.'),(812,254,'_accordion_group_1_accordion_description_first','field_621e008e37dae'),(813,254,'accordion_group_1_accordion_description_second',''),(81