n_one','field_6220c2700020a'),(1151,244,'accordion_simple_0_accordion_description_two','The Aurora Travel Baseball Association was then formed as a not-for-profit 501(c)(3) organization to fill this need. Furthermore, three goals were set forth: (1) To prepare our players to be able to compete at the next major level, whether it be high school, college, or beyond; (2) To have more concern for the all around development of our players, than in securing wins; and, (3) To strive to have our Managers ASEP/IHSA coaching certified.'),(1152,244,'_accordion_simple_0_accordion_description_two','field_6220c2770020b'),(1153,244,'accordion_simple_0_accordion_description_three','Aurora Travel Baseball (ATB) believes that there is room for all levels of baseball within our area. To this end, ATB reaches out to all surrounding communities in the Aurora, Illinois metropolitan area to find the best players with the desire for this type of intensive, competitive play. This results in our family of players coming from Aurora, Naperville, North Aurora, Oswego, Batavia, Yorkville, and other Fox Valley communities.'),(1154,244,'_accordion_simple_0_accordion_description_three','field_6220c2870020c'),(1155,244,'accordion_simple_0_accordion_card_two_title',''),(1156,244,'_accordion_simple_0_accordion_card_two_title','field_6220c29d0020d'),(1157,244,'accordion_simple_0_accordion_description_venues',''),(1158,244,'_accordion_simple_0_accordion_description_venues','field_6220c2a90020e'),(1159,244,'accordion_simple_0_accordion_card_three_title',''),(1160,244,'_accordion_simple_0_accordion_card_three_title','field_6220c2b70020f'),(1161,244,'accordion_simple_0_description_past_tournament',''),(1162,244,'_accordion_simple_0_description_past_tournament','field_6220c2c100210'),(1163,244,'accordion_simple_0_accordion_card_four_title',''),(1164,244,'_accordion_simple_0_accordion_card_four_title','field_6220c2d600211'),(1165,244,'accordion_simple_0_description_additional_info',''),(1166,244,'_accordion